import React from 'react';
import Backdrop from '../Backdrop/Backdrop';
import classes from './Confirm.module.css';

const Confirm = (props) => {
	return (
		<Backdrop className={classes.ConfirmOuter}>
			<div className={classes.Confirm}>
				<p className={classes.ConfirmText}>{props.confirmText}?</p>
				<div>
					<button onClick={()=>{props.onCancel()}} className={classes.Cancel}>取消</button>
					<button onClick={()=>{props.onO}} className={classes.Ok}>确认</button>
				</div>
			</div>
		</Backdrop>
	);
};

export default Confirm;
